import React from 'react';
import logo from './logo.svg';
import './App.css';
import { DropList } from './components/DropList/DropList'
import { Rating } from './components/Rating/Rating'

// alert('Let start')

function App() {
  return (
    <div>
      <h1><AppTitle /></h1>
      <DropList />
      <Rating value={4} />
      <Rating value={2} />
    </div>
  );
}

function AppTitle() {
  return (
    <React.Fragment>This is APP</React.Fragment>
  )
}

export default App;
